description:
Настенный антивандальный шкаф 9U предназначен для установки оборудования в местах с общим доступом.
Цельнометаллическая сварная конструкция, выполненная из листовой стали толщиной 1,5 мм, обладает повышенной устойчивостью к деформации и взлому. Для удобства монтажа и обслуживания оборудования, установлена дверь пенального типа.
Дверь фиксируется замком типа CLASS стойким к подбору ключей и механическим повреждениям. Антивандальный шкаф имеет 4 крепежных отверстия в задней стенке. Для ввода кабелей антивандальные шкафы оборудованы двумя отверстиями в нижней части. 
Шкаф комплектуется парой вертикальных направляющих. Поставляется с защитными уголками без индивидуальной упаковки. По заказу клиента возможна дополнительная упаковка в индивидуальную картонную коробку.
Расстояние от двери до стоек – 70 мм. Высота стоек – 460 мм. Кабельный ввод - 60х40 мм. Покрытие – порошковая эмаль (RAL 7035). 

Конструктивные характеристики:

Высота: 465 мм;
Ширина: 600 мм;
Глубина: 400 мм;
Полезная глубина: 305 мм;
Расстояние от двери до стоек: 70 мм;
Высота стоек: 460 мм;
Кабельный ввод - 60х40 мм;
Крепежные отверстия - 4 шт;
Материал - листовая сталь толщиной 1,5 мм;
Покрытие – порошковая эмаль (RAL 7035);
Замок: "CLASS".

Настенный антивандальный шкаф 8U предназначен для защиты оборудования в местах с возможностью несанкционированного доступа. Корпус изделия выполнен в виде цельносварной конструкции из листовой стали толщиной 1,5 мм. 
На боковых стенках – отверстия для циркуляции воздуха и уменьшения нагрева оборудования. На задней стенке – пять крепежных отверстий, усиленных стальными пластинами. Шкаф крепится к стене при помощи анкеров.
Распаячные отверстия сделаны под кабель на 2,4 Ггц. Дверь утоплена на 40 мм: возможность поддеть ее исключена. 
Замок врезан в профиль, а остальная его часть защищена дополнительными накладками, что исключает выбивание или деформацию замочной скважины.
Шкаф поставляется с защитными уголками без индивидуальной упаковки (по заказу возможна картонная коробка). 
Внутр. глубина от стоек до задней стенки - 350 мм. Кабельный ввод - 60х40 мм. Покрытие – порошковая эмаль (RAL 7035).

Конструктивные характеристики:

Высота: 450 мм;
Ширина: 620 мм;
Глубина: 400 мм;
Полезная глубина: 305 мм;
Внутренняя глубина от двери до задней стенки 350 мм;
Внутренняя глубина от стойки до задней стенки 255 мм;
Кабельный ввод - 60х40 мм;
Крепежные отверстия - 4 шт;
Материал - листовая сталь толщиной 1,5 мм;
Покрытие – порошковая эмаль (RAL 7035);
Замок: "CLASS".

